insert into `acceptance_form` (`id`,`name`,`order_num`,`content`,`button1_text`,`button2_text`,`active`,`created`) values (1,'Consent Form',1,'<html xmlns:o=\"urn:schemas-microsoft-com:office:office\"\nxmlns:w=\"urn:schemas-microsoft-com:office:word\"\nxmlns:st1=\"urn:schemas-microsoft-com:office:smarttags\"\nxmlns=\"http://www.w3.org/TR/REC-html40\">\n\n<head>\n<meta http-equiv=Content-Type content=\"text/html; charset=windows-1252\">\n<meta name=ProgId content=Word.Document>\n<meta name=Generator content=\"Microsoft Word 11\">\n<meta name=Originator content=\"Microsoft Word 11\">\n<link rel=File-List\nhref=\"cmu-irb-consent-form-lebiere-online-2010_files/filelist.xml\">\n<title>SAMPLE COMBINED CONSENT/AUTHORIZATION</title>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"place\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"PlaceType\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"PlaceName\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"address\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"PostalCode\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"State\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"City\"/>\n<o:SmartTagType namespaceuri=\"urn:schemas-microsoft-com:office:smarttags\"\n name=\"Street\"/>\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:Zoom>110</w:Zoom>\n  <w:SpellingState>Clean</w:SpellingState>\n  <w:GrammarState>Clean</w:GrammarState>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\n </w:WordDocument>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:LatentStyles DefLockedState=\"false\" LatentStyleCount=\"156\">\n </w:LatentStyles>\n</xml><![endif]--><!--[if !mso]><object\n classid=\"clsid:38481807-CA0E-42D2-BF39-B33AF135CC4D\" id=ieooui></object>\n<style>\nst1\\:*{behavior:url(#ieooui) }\n</style>\n<![endif]-->\n<style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:Tahoma;\n	panose-1:2 11 6 4 3 5 4 4 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:1627421319 -2147483648 8 0 66047 0;}\n@font-face\n	{font-family:Times;\n	panose-1:2 2 6 3 5 4 5 2 3 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-format:other;\n	mso-font-pitch:variable;\n	mso-font-signature:3 0 0 0 1 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-parent:\"\";\n	margin:0in;\n	margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-fareast-font-family:\"Times New Roman\";}\nh3\n	{margin:0in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	mso-pagination:widow-orphan;\n	page-break-after:avoid;\n	mso-outline-level:3;\n	layout-grid-mode:char;\n	font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	letter-spacing:-.15pt;\n	font-weight:normal;\n	text-decoration:underline;\n	text-underline:single;}\nh4\n	{margin-top:0in;\n	margin-right:0in;\n	margin-bottom:0in;\n	margin-left:4.5in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	text-indent:-4.5in;\n	mso-pagination:widow-orphan;\n	page-break-after:avoid;\n	mso-outline-level:4;\n	layout-grid-mode:char;\n	font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	letter-spacing:-.15pt;\n	text-decoration:underline;\n	text-underline:single;}\nh5\n	{margin-top:0in;\n	margin-right:0in;\n	margin-bottom:0in;\n	margin-left:4.5in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	text-indent:-4.5in;\n	mso-pagination:widow-orphan;\n	page-break-after:avoid;\n	mso-outline-level:5;\n	layout-grid-mode:char;\n	font-size:12.0pt