ent, div.MsoBodyTextIndent\n	{margin-top:0in;\n	margin-right:0in;\n	margin-bottom:0in;\n	margin-left:.5in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	text-indent:-.5in;\n	mso-pagination:widow-orphan;\n	layout-grid-mode:char;\n	font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	mso-fareast-font-family:\"Times New Roman\";\n	letter-spacing:-.15pt;}\np.MsoBodyText2, li.MsoBodyText2, div.MsoBodyText2\n	{margin:0in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	mso-pagination:widow-orphan;\n	layout-grid-mode:char;\n	font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	mso-fareast-font-family:\"Times New Roman\";\n	letter-spacing:-.15pt;\n	font-weight:bold;\n	font-style:italic;\n	text-decoration:underline;\n	text-underline:single;}\np.MsoBodyText3, li.MsoBodyText3, div.MsoBodyText3\n	{margin:0in;\n	margin-bottom:.0001pt;\n	text-align:justify;\n	mso-pagination:widow-orphan;\n	layout-grid-mode:char;\n	font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	mso-fareast-font-family:\"Times New Roman\";\n	letter-spacing:-.15pt;\n	font-weight:bold;}\np.MsoBodyTextIndent2, li.MsoBodyTextIndent2, div.MsoBodyTextIndent2\n	{margin-top:0in;\n	margin-right:0in;\n	margin-bottom:0in;\n	margin-left:.25in;\n	margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:12.0pt;\n	font-family:Times;\n	mso-fareast-font-family:\"Times New Roman\";\n	mso-bidi-font-family:\"Times New Roman\";\n	letter-spacing:-.1pt;}\na:link, span.MsoHyperlink\n	{color:blue;\n	text-decoration:underline;\n	text-underline:single;}\na:visited, span.MsoHyperlinkFollowed\n	{color:purple;\n	text-decoration:underline;\n	text-underline:single;}\np.MsoCommentSubject, li.MsoCommentSubject, div.MsoCommentSubject\n	{margin:0in;\n	margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-fareast-font-family:\"Times New Roman\";\n	font-weight:bold;}\np.MsoAcetate, li.MsoAcetate, div.MsoAcetate\n	{margin:0in;\n	margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:8.0pt;\n	font-family:Tahoma;\n	mso-fareast-font-family:\"Times New Roman\";}\nspan.charchar\n	{mso-style-name:charchar;\n	font-family:Times;\n	mso-ascii-font-family:Times;\n	mso-hansi-font-family:Times;\n	mso-bidi-font-family:Times;\n	letter-spacing:-.1pt;}\nspan.msoins0\n	{mso-style-name:msoins;\n	color:teal;\n	text-decoration:underline;\n	text-underline:single;}\nspan.msodel0\n	{mso-style-name:msodel;\n	color:red;\n	text-decoration:line-through;}\nspan.SpellE\n	{mso-style-name:\"\";\n	mso-spl-e:yes;}\n@page Section1\n	{size:8.5in 11.0in;\n	margin:.7in .8in .7in .8in;\n	mso-header-margin:.5in;\n	mso-footer-margin:.5in;\n	mso-paper-source:0;}\ndiv.Section1\n	{page:Section1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin:0in;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-ansi-language:#0400;\n	mso-fareast-language:#0400;\n	mso-bidi-language:#0400;}\n</style>\n<![endif]-->\n</head>\n\n<body lang=EN-US link=blue vlink=purple style=\'tab-interval:.5in\'>\n\n<div class=Section1>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Study Title: </span></b>Modeling\nStrategies in Large Human-Machine Networked Systems<span style=\'color:blue;\nletter-spacing:-.15pt\'> </span>HS# HS08-248</p>\n\n<p class=MsoNormal><b>&nbsp;</b></p>\n\n<p class=MsoNormal><b>Principal Investigator:</b> Dr. Christian <span\nclass=SpellE>Lebiere</span>, Research Faculty</p>\n\n<p class=MsoNormal style=\'margin-left:.5in;text-align:justify;page-break-after:\navoid\'><span style=\'letter-spacing:-.15pt\'>Psychology Department, <st1:address\nw:st=\"on\"><st1:Street w:st=\"on\">5000 Forbes Avenue</st1:Street>, <st1:City\n w:st=\"on\">Pittsburgh</st1:City> <st1:State w:st=\"on\">PA</st1:State> <st1:PostalCode\n w:st=\"on\">15213</st1:PostalCode></st1:address></span></p>\n\n<p class=MsoNormal style=\'margin-left:.5in;text-align:justify;page-break-after:\navoid\'><span style=\'letter-spacing:-.15pt\'>412-268-6028; cl@cmu.edu</span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>_______________________________________________________________________________</span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Purpose of this Study</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>The purpose of the Study\nis to investigate decision-making as it relates to networked missions.</span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Procedures</span></b><span\nstyle=\'letter-spacing:-.15pt\'>&nbsp; </span></p>\n\n<p class=MsoNormal><a name=\"OLE_LINK1\">You </a><span style=\'letter-spacing:\n-.15pt\'>will be asked to interact with a computer simulation involving a\nnetworked environment scenario. </span>You <span style=\'letter-spacing:-.15pt\'>will\nbe charged with </span>acquiring and trading <span style=\'letter-spacing:-.15pt\'>resources</span>\nand making decisions regarding<span style=\'letter-spacing:-.15pt\'> a mission</span>\nand with communicating with other participants as you go along<span\nstyle=\'letter-spacing:-.15pt\'>.&nbsp; </span>You <span style=\'letter-spacing:\n-.15pt\'>may </span>also <span style=\'letter-spacing:-.15pt\'>be asked to\ncomplete a basic background questionnaire and provide verbal feedback about </span>your\n<span style=\'letter-spacing:-.15pt\'>experience.<o:p></o:p></span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>The study duration is\napproximately 120 minutes.&nbsp; The study will be conducted </span>over a Web\ninterface at a place of your choosing.<span style=\'letter-spacing:-.15pt\'><o:p></o:p></span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Participant\nRequirements</span></b><span style=\'letter-spacing:-.15pt\'>&nbsp; </span></p>\n\n<p class=MsoNormal>You <span style=\'letter-spacing:-.15pt\'>must be 18 years of\nage to participate. </span>We may use technology (anonymous &quot;cookies&quot;) to\nensure we can identify you in case you take the experiment multiple\ntimes.&nbsp;&nbsp;<span style=\'letter-spacing:-.15pt\'><o:p></o:p></span></p>\n\n<p class=MsoNormal><o:p>&nbsp;</o:p></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></b></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Risks</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>The risks and discomfort\nassociated with participation in this study are no greater than those\nordinarily encountered in daily life or during the performance of routine\nphysical or psychological examinations or tests. </span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Benefits</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>There may be no personal\nbenefit from your participation in the study but the knowledge received may be\nof value to humanity.</span>&nbsp;The experiment is designed to be engaging and\nenjoyable.<span style=\'letter-spacing:-.15pt\'><o:p></o:p></span></p>\n\n<p class=MsoNormal><span style=\'color:blue;letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Compensation &amp;\nCosts</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>There will be no cost to\nyou if you participate in this study.</span>&nbsp; Where advertised so, you are\nentered into a lottery to win a valuable item; entry into the lottery with\naverage chances of winning will not depend on you concluding the\nexperiment.&nbsp; We will communicate the duration of each lottery and how many\nparticipants we expect to participate to the participants.&nbsp; Chances of\nsuccess may be increased with your success in the game: if you do well, you can\nwin additional prizes.&nbsp; We will tell you about that in our advertisements\nand in the game.&nbsp; (Note that all trading, buying and selling in the game\nis done with virtual goods; they are not redeemable for real-life valuables or\nmoney.)<span style=\'letter-spacing:-.15pt\'><o:p></o:p></span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal style=\'margin-right:.9pt\'><b><span style=\'letter-spacing:\n-.15pt\'>Confidentiality</span></b></p>\n\n<p class=MsoNormal style=\'margin-right:-10.0pt;text-autospace:none\'>By\nparticipating in the study, you understand and agree that Carnegie Mellon may\nbe required to disclose your consent form, data and other personally\nidentifiable information as required by law, regulation, subpoena or court\norder.&nbsp; Otherwise, your confidentiality will be maintained in the\nfollowing manner:</p>\n\n<p class=MsoNormal style=\'margin-right:-10.0pt;text-autospace:none\'>&nbsp;</p>\n\n<p class=MsoNormal style=\'margin-right:-10.0pt;text-autospace:none\'>Your data\nand consent form will be kept separate. Your consent form will be stored in a\nlocked location on Carnegie Mellon property and will not be disclosed to third\nparties. By participating, you understand and agree that the data and\ninformation gathered during this study may be used by Carnegie Mellon and\npublished and/or disclosed by Carnegie Mellon to others outside of Carnegie\nMellon.&nbsp; However, your name, address, contact information and other direct\npersonal identifiers in your consent form will not be mentioned in any such\npublication or dissemination of the research data and/or results by Carnegie\nMellon.&nbsp; </p>\n\n<p class=MsoNormal style=\'margin-right:.9pt\'><b>&nbsp;</b></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Rights</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>Your participation is\nvoluntary.&nbsp; You are free to stop your participation at any point.&nbsp;\nRefusal to participate or withdrawal of your consent or discontinued\nparticipation in the study will not result in any penalty or loss of benefits\nor rights to which you might otherwise be entitled.&nbsp; The Principal\nInvestigator may at his/her discretion remove you from the study for any of a\nnumber of reasons.&nbsp; In such an event, you will not suffer any penalty or\nloss of benefits or rights which you might otherwise be entitled.</span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><b>&nbsp;</b></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><b>Right\nto Ask Questions &amp; Contact Information</b></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>If you have any questions about this study, you\nshould feel free to ask them now or anytime throughout the study by contacting:\n<o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>Dr. Christian <span class=SpellE>Lebiere</span><o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>Psychology Department<o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>345A Baker Hall<o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>Email: cl@cmu.edu <o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'>(412) 268-6028<o:p></o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'><span\nstyle=\'letter-spacing:-.15pt\'><o:p>&nbsp;</o:p></span></p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'>If you\nhave questions later, desire additional information, or wish to withdraw your\nparticipation please contact the Princip<span class=msoins0>al</span>\nInvestigator by mail, phone or e-mail in accordance with the contact\ninformation listed on the first page of this consent.&nbsp; </p>\n\n<p class=MsoNormal style=\'text-align:justify;page-break-after:avoid\'>&nbsp;</p>\n\n<p class=MsoNormal>If you have questions pertaining to your rights as a\nresearch participant; or to report objections to this study, you should contact\nthe Research Regulatory Compliance Office at <st1:place w:st=\"on\"><st1:PlaceName\n w:st=\"on\">Carnegie</st1:PlaceName> <st1:PlaceName w:st=\"on\">Mellon</st1:PlaceName>\n <st1:PlaceType w:st=\"on\">University</st1:PlaceType></st1:place>.&nbsp; Email: <a\nhref=\"mailto:irb-review@andrew.cmu.edu\">irb-review@andrew.cmu.edu</a> . Phone:\n412-268-1901 or 412-268-5460.</p>\n\n<p class=MsoNormal style=\'text-align:justify\'>&nbsp;</p>\n\n<p class=MsoNormal style=\'text-align:justify\'>T<span style=\'letter-spacing:\n-.15pt\'>he Carnegie Mellon University Institutional Review Board (IRB) has\napproved the use of human participants for this study. </span></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Conflict of Interest</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>This study is funded by\nAir Force Office of Scientific Research, which is supporting the costs of this\nresearch. <b>Neither</b> <st1:place w:st=\"on\"><st1:PlaceName w:st=\"on\">Carnegie</st1:PlaceName>\n <st1:PlaceName w:st=\"on\">Mellon</st1:PlaceName> <st1:PlaceType w:st=\"on\">University</st1:PlaceType></st1:place>,\n<b>nor</b> Dr. Christian <span class=SpellE>Lebiere</span> will receive any\nfinancial benefit based on the results of this study.</span></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>&nbsp;</span></b></p>\n\n<p class=MsoNormal><b><span style=\'letter-spacing:-.15pt\'>Voluntary Consent</span></b></p>\n\n<p class=MsoNormal><span style=\'letter-spacing:-.15pt\'>By clicking the &quot;I\nAccept&quot; button below, you agree that the above information has been explained\nto you and all your current questions have been answered.&nbsp; You understand\nthat you may ask questions about any aspect of this research study during the\ncourse of the study and in the future.&nbsp; By signing this form, you agree to\nparticipate in this research study.&nbsp; </span></p>\n\n<p class=MsoNormal style=\'page-break-after:avoid\'><span style=\'letter-spacing:\n-.15pt\'>&nbsp;</span></p>\n\n<p class=MsoNormal style=\'page-break-after:avoid\'><span style=\'letter-spacing:\n-.15pt\'>I certify that I have explained the nature and purpose of this research\nstudy to the above individual and I have discussed the potential benefits and\npossible risks of participation in the study.&nbsp; Any questions the\nindividual has about this study have been answered and any future questions\nwill be answered as they arise.</span></p>\n\n</div>\n\n</body>\n\n</html>\n','I accept','I do not accept','','2010-08-25 12:09:50');
