--[if gte mso 9]><xml>\n <o:shapedefaults v:ext=\"edit\" spidmax=\"13314\"/>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <o:shapelayout v:ext=\"edit\">\n  <o:idmap v:ext=\"edit\" data=\"1\"/>\n </o:shapelayout></xml><![endif]-->\n</head>\n\n<body lang=EN-US style=\'tab-interval:.5in\'>\n\n<div class=Section1>\n\n<p class=MsoNormal><b style=\'mso-bidi-font-weight:normal\'><i style=\'mso-bidi-font-style:\nnormal\'><span style=\'color:blue\'>Familiarization Phase:<o:p></o:p></span></i></b></p>\n\n<p class=MsoNormal><span style=\'color:blue\'>The first phase of the game will last\n5 minutes. Feel free to try out the interface and ensure that you feel familiar\nwith the controls. Try to communicate with your teammates and to move around\nthe map, while trying to find your goal item. The score that you accumulate\nduring this phase will not count towards your final score.<o:p></o:p></span></p>\n\n</div>\n\n</body>\n\n</html>\n','I have read these instructions',NULL,'','2010-08-25 12:31:15');
