.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin:0in;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-ansi-language:#0400;\n	mso-fareast-language:#0400;\n	mso-bidi-language:#0400;}\n</style>\n<![endif]--><!--[if gte mso 9]><xml>\n <o:shapedefaults v:ext=\"edit\" spidmax=\"7170\"/>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <o:shapelayout v:ext=\"edit\">\n  <o:idmap v:ext=\"edit\" data=\"1\"/>\n </o:shapelayout></xml><![endif]-->\n</head>\n\n<body lang=EN-US style=\'tab-interval:.5in\'>\n\n<div class=Section1>\n\n<p class=MsoNormal><b style=\'mso-bidi-font-weight:normal\'><i style=\'mso-bidi-font-style:\nnormal\'><span style=\'color:#9BBB59\'>Game #2:<o:p></o:p></span></i></b></p>\n\n<p class=MsoNormal><b style=\'mso-bidi-font-weight:normal\'><i style=\'mso-bidi-font-style:\nnormal\'><span style=\'color:#9BBB59\'>The best way to exchange messages is to\nprovide your teammates with information as you go along.</span></i></b><i\nstyle=\'mso-bidi-font-style:normal\'><span style=\'color:#9BBB59\'> Whenever you\nget to a location, go ahead and tell them about interesting items that are\navailable there. For example, you may tell them that &quot;there is an emerald\nin <span class=SpellE>Sandefjord</span>!&quot;, but also that &quot;the road\nfrom <st1:place w:st=\"on\"><st1:City w:st=\"on\">Pittsburgh</st1:City></st1:place>\nto <span class=SpellE>Sandefjord</span> is really slow&quot;. Feel free to pass\non information that you get from other teammates by simply typing that\ninformation in again. Remember that those whose messages you see cannot\nnecessarily talk to each other.</span></i></p>\n\n</div>\n\n</body>\n\n</html>\n','I have read these instructions',NULL,'\0','2010-08-24 12:39:00');
